import {Link} from "react-router-dom";
import Data from "../../pages/Accueil/data.json"

function Appartement () {
    const appartements = Data
    const listAppartements = appartements.map((appartement) =>
        <Link to="/logement" query={ appartement.id} >
            <div className="article" key={appartement.id}>
                <img className="article__cover" src={appartement.cover} />
                <p className="article__title">{appartement.title}</p>
            </div>
        </Link>
    )

    return (
        <div id="articles" >
            {listAppartements}
        </div>
    )
}

export default Appartement
